export const App = memo(() => {
  return (
    <>

        <Navigation/>
        <Routes>
          <Route  path="/"  element= {<HomePage/>} />
          <Route path="/movies" element={<MoviesPage/>}/>
          <Route path="/movieDetails" element={<MovieDetailsPage/>}/>
        </Routes>

    </>
    )
  })
